import BaseComponent from "bootstrap/js/dist/base-component";
import Base from "../components/Base";
import { useParams } from "react-router-dom";

const PostPage = () => {
  const { id } = useParams();
  
  return (
    <Base>
      <div>
        <h1>This is Post page</h1>
        <h1>{id}</h1>
        
      </div>
    </Base>
  );
};
export default PostPage;
